import Link from 'next/link';

const Navbar = () =>  (

    <div>

        <nav className="navbar navbar-default">
        <div className="container-fluid">
            <ul className="nav navbar-nav">
                <li><Link href="/">Home</Link></li>
                <li><Link href="about">About Us</Link></li>
            </ul>
        </div>
        </nav>

          
    </div>

);


export default Navbar;
